import axios from 'axios'

const baseUrl = 'http://localhost:8080/v1'

//para consumir la API
async function getProducts () {
    try {
        const response = await axios({
            url:`${baseUrl}/products`,
            method:'GET'
        })

        return response
    } catch (e) {
        console.log(e)
    }
}
